import React , {Component} from "react";
import App from "./App";
import "./App.css"

class Items extends Component { 
    constructor(){
        super()
        this.change_style = this.change_style.bind(this)
    }
   
    
    render(){
      return (
          <button onClick={this.change_style}> Change Style </button>
      );
    }
}

export default Items;
